import React from 'react';
import Attributes from '../Attributes';
import Picture from './';
import ScientificName from '../ScientificName';

const base64EncodedImage = "";

export default { title: 'Picture' };

export const basic = () => (
  <Picture
    src={`data:image/png;base64,${base64EncodedImage}`}
  />
);

export const withBlackBackground = () => (
  <Picture
    backgroundColor='#000000'
    src={`data:image/png;base64,${base64EncodedImage}`}
  />
);

export const withMissingSource = () => (
  <Picture src={null} />
);

export const withSlowlyLoadingSource = () => {
  const handleLoad = (event, defaultLoad) => {
    window.setTimeout(() => defaultLoad(event), 5000);
  };
  return (
    <Picture
      onLoad={handleLoad}
      src={`data:image/png;base64,${base64EncodedImage}`}
    />
  );
};

export const withAttributes = () => (
  <Picture
    src={`data:image/png;base64,${base64EncodedImage}`}
    title={(
      <ScientificName>
        Ceratium furca
      </ScientificName>
    )}
    caption="Artificial colouring has been added to this image. The original SEM image is grayscale."
  >
    <Attributes
      list={[
        {name: "Title", value: "Ceratium furca"},
        {name: "Photographer/artist", value: "Bengt Karlson"},
        {name: "Copyright holder", value: "Bengt Karlson"},
        {name: "Institute", value: "University of Gothenburg, Marine botany"},
        {name: "Contributing organisation", value: "University of Gothenburg"},
        {name: "Contributor", value: "Bengt Karlson"},
        {name: "Caption", value: "Artificial colouring has been added to this image. The original SEM image is grayscale."},
        {name: "License", value: "Creative Commons Attribution-NoDerivs 3.0 Unported"},
        {name: "Technique", value: "SEM Scanning Electron Microscopy"},
        {name: "Preservation", value: "Not described"},
        {name: "Contrast enhancement", value: "Not described"},
        {name: "Stain", value: "Sputter coated"},
        {name: "Image galleries", value: "Skagerrak-Kattegat"},
      ]}
    />
  </Picture>
);
